import React from "react"

function Project(props){

    console.log(props.project.tools)

    const skills = () => {
        <ul>
            {props.project.tools.map(function(item){
                return <li key={item.id}>{item}</li>
            })}
        </ul>
    }

    const image = require("../portfolio_assets/FixGradKappa2.png")
    if(props.pos == "l"){
        return(
            <div className={props.container}>
                <img src={image} alt="text" className={props.icon}></img>
                <article>
                    <h2 className={props.h2}>{props.project.caption}</h2>
                    <p className={props.p}>{props.project.text}</p>
                </article>
                <p></p>
            </div>
        )
    }
    else{
        return(
            <div className={props.container}>
                <p></p>
                <article>
                    <h2 className={props.h2}>{props.project.caption}</h2>
                    <p className={props.p}>{props.project.text}</p>
                </article>
                <img src={image} alt="text" className={props.icon}></img>
            </div>
        )
    }
}

export default Project
